script: |
  super -f tsv -I q4604.sql | sort > q4604.out

vector: true

inputs:
  - name: q4604.sql
    data: |
      SELECT DISTINCT - + col2 AS col2 FROM tab1 WHERE NOT ( col0 ) IS NULL OR NOT 95 + + col0 + col2 * + - 59 IS NOT NULL;
  - name: tab1

outputs:
  - name: q4604.out
    data: |
      -59
      -68
      -96
